    function renderDefault()
    {
        $wwwDir = $this->context->parameters['wwwDir'];

        $gallery = new \GalleryModel();

        if ($this->galleryName !== '') {
            $this->template->gallery = $gallery->getFiles($this->galleryName);
        }


//        $this->template->vyletiVtacik = $gallery->getFiles(\GalleryModel::VYLETI_VTACIK);
//
//        $this->template->predsvadobne = $gallery->getFiles(\GalleryModel::PREDSVADOBNE);
//        $this->template->svadobne = $gallery->getFiles(\GalleryModel::SVADOBNE);

        $this->template->heroLogoBase64 = 'data:image/png;base64,';
//        $this->template->heroLogoBase64 = Nette\Utils\Image::fromFile($wwwDir . '/img/hero-logo.png');
    }
}
